<script type="application/json" data-for="htmlwidget-0264ffcbfc8e11edc809">{"x":{"options":{"maxZoom":12,"crs":{"crsClass":"L.CRS.EPSG3857","code":null,"proj4def":null,"projectedBounds":null,"options":{}},"zoomControl":false,"scrollWheelZoom":false},"calls":[{"method":"addProviderTiles","args":["Esri.WorldGrayCanvas",null,null,{"minZoom":0,"maxZoom":12,"tileSize":256,"subdomains":"abc","errorTileUrl":"","tms":false,"noWrap":false,"zoomOffset":0,"zoomReverse":false,"opacity":1,"zIndex":1,"detectRetina":false}]},{"method":"setMaxBounds","args":[-180,-90,180,90]},{"method":"addMarkers","args":[[39.9527237,39.1014537,41.8755616,29.7589382,27.6886419,43.6534817,33.5386858,14.6508,-6.175247,36.1672559,42.0653768,37.2333253,34.0536909,19.4326296,51.46327795,33.7489924,40.833989,-37.8142454,1.357107],[-75.16352620000001,-84.51246020000001,-87.6244212,-95.3676974,-82.5723193,-79.3839347,-112.185994,121.04821,106.8270488,-115.148516,-71.2478308,-121.6846349,-118.242766,-99.1331785,-0.1200220716236515,-84.39026440000001,-74.0970865,144.9631732,103.8194992],{"iconUrl":{"data":"data:image/png;base64,","index":0},"iconWidth":64,"iconHeight":64,"iconAnchorX":22,"iconAnchorY":94,"shadowUrl":{"data":"http://leafletjs.com/examples/custom-icons/leaf-shadow.png","index":0},"shadowWidth":50,"shadowHeight":64,"shadowAnchorX":4,"shadowAnchorY":62},null,null,{"interactive":true,"draggable":false,"keyboard":true,"title":"","alt":"","zIndexOffset":0,"opacity":1,"riseOnHover":false,"riseOffset":250},null,null,null,null,["<b>Philadelphia, PA<\/b><br/><br/>Hotel bookings in Philadelphia surged to their highest levels since the start of the pandemic, all thanks to Taylor Swift's concert dates. During the nights of Swift's tour, hotel occupancy increased by 11%, and the revenue per available room went up by an average of 59%.\n<br><br><a href=\"https://www.nbcnews.com/business/consumer/taylor-swift-federal-reserve-credits-eras-tour-boosting-hotels-tourism-rcna94046; https://www.cnbc.com/2023/09/08/taylor-swift-is-single-handedly-giving-a-boost-to-hotel-industry-revenue.html\">Source<\/a>","<b>Cincinnati, OH<\/b><br/><br/>Cincinnati officials attributed Taylor Swift's Eras Tour to downtown hotels making over $2.6 million and surrounding Hamilton County hotels earning more than $5.3 million.<br><br><a href=\"https://www.nbcnews.com/business/consumer/taylor-swift-federal-reserve-credits-eras-tour-boosting-hotels-tourism-rcna94046\">Source<\/a>","<b>Chicago, IL<\/b><br/><br/>Choose Chicago, the official tourism and marketing organization for Chicago, reported that the first weekend in June 2023 set new hotel occupancy records. This was due in part to events such as Taylor Swift's sold-out shows at Soldier Field.\nDuring the week of June 4-10, the Chicago Transit Authority (CTA) provided 5.63 million rides, the highest number since the pandemic began in 2020. CTA specifically mentioned that Taylor Swift's sold-out concert at Soldier Field played a significant role in this increase. The three-night event resulted in more than 43,000 additional bus and rail rides, according to CTA.<br><br><a href=\"https://www.nbcnews.com/business/consumer/taylor-swift-federal-reserve-credits-eras-tour-boosting-hotels-tourism-rcna94046  https://www.cnn.com/2023/06/22/business/taylor-swift-concerts-public-transit/index.html\">Source<\/a>","<b>Houston, TX<\/b><br/><br/>Taylor Swift's three-night performances at NRG Stadium led to the most profitable week for hotels in the city in 2023.<br><br><a href=\"https://www.bizjournals.com/houston/news/2023/05/03/taylor-swift-eras-tour-houston-hotels.html\">Source<\/a>","<b>Tampa Bay, Florida<\/b><br/><br/>Visit Tampa Bay projected that hotel occupancy in Tampa would increase by 60 to 80 percent during the weekend of Taylor Swift's performance. Additionally, Taylor Swift's previous two tours that included stops in Tampa generated $730,000 in tax revenue for the city.<br><br><a href=\"https://www.forbes.com/sites/conormurray/2023/04/21/taylor-swifts-eras-tour-has-mayors-groveling-for-her-attention-heres-what-theyve-given-her-so-far/?sh=2703dd5c4fc1\">Source<\/a>","<b>Toronto, Canada<\/b><br/><br/>Canadian Parliament members expressed their dissatisfaction with the Eras Tour not including Canada and filed a grievance with the Speaker of the House of Commons. Following this, Prime Minister Justin Trudeau extended an invitation to Taylor Swift to tour Canada. Just one month later, Swift announced six shows in Toronto.<br><br><a href=\"https://www.thestar.com/politics/federal/2023/06/21/mp-files-official-grievance-with-speaker-over-taylor-swift-snubbing-canada-on-tour.html, https://en.wikipedia.org/wiki/Impact_of_the_Eras_Tour#cite_note-France_24_Trudeau-11\">Source<\/a>","<b>Glendale, Arizona<\/b><br/><br/>Glendale, Arizona renamed itself Swift City to honor Taylor Swift for kicking off the Eras Tour with two sold-out shows at State Farm Stadium on Friday and Saturday, March 17-18, 2023.<br><br><a href=\"https://www.azcentral.com/story/entertainment/music/2023/03/13/glendale-az-name-change-taylor-swift-eras-tour/69995759007/\">Source<\/a>","<b>Quezon City, Philippines<\/b><br/><br/>Media outlets had covered stories of significant crowds of fans assembling at different malls in the Philippines to witness performances imitating the Eras Tour by Taylor Sheesh, a Filipino drag queen and Taylor Swift impersonator.<br><br><a href=\"https://www.rollingstone.com/music/music-news/taylor-swift-philippines-drag-show-eras-tour-1234740131/\">Source<\/a>","<b>Jakarta, Indonesia<\/b><br/><br/>The Indonesian Minister of Tourism and Creative Economy, Sandiaga Uno, noticed that the Eras Tour didn't include Indonesia, even though it's the largest economy in Southeast Asia. As a result, he decided to simplify the permit process for international touring acts.<br><br><a href=\"https://qz.com/taylor-swifts-snub-and-coldplays-skim-prompted-indonesi-1850698993\">Source<\/a>","<b>Las Vegas, Nevada<\/b><br/><br/>The Las Vegas Convention and Visitors Authority acknowledged that the tour played a significant role in bringing the economy of Las Vegas back to the levels it had before the pandemic, effectively restoring it to its pre-pandemic state.<br><br><a href=\"https://www.bloomberg.com/news/articles/2023-05-01/taylor-swift-helps-boost-las-vegas-tourism-to-pre-covid-levels\">Source<\/a>","<b>Foxborough, Massachusetts<\/b><br/><br/>In the days leading up to the Eras Tour shows in nearby Foxborough, Massachusetts, all hotel rooms, restaurant reservations, and train tickets in Boston were completely booked, with no availability left.<br><br><a href=\"https://www.bizjournals.com/boston/news/2023/05/17/taylor-swift-sells-out-boston.html?utm_source=sy&utm_medium=lsyp&utm_campaign=nbcboston&utm_content=nbcboston\">Source<\/a>","<b>Santa Clara, California<\/b><br/><br/>Santa Clara experienced hotel occupancy rates of at least 98% in the weeks leading up to the tour's arrival in the city.<br><br><a href=\"https://abc7news.com/taylor-swift-eras-tour-levis-stadium-concert-santa-clara/13530461/\">Source<\/a>","<b>Los Angeles, California<\/b><br/><br/>The tour in Los Angeles generated a $320 million boost to the county's gross domestic product (GDP).<br><br><a href=\"https://www.birmingham.ac.uk/news/2023/taylor-swifts-eras-tour-a-harmonious-overture-of-the-trickle-down-effect-on-local-economies\">Source<\/a>","<b>Mexico City, Mexico<\/b><br/><br/>Taylor Swift's concerts in Mexico City generated an estimated revenue of Mex$1,000,000,000, which is equivalent to $59 million USD, across the city.<br><br><a href=\"https://mexiconewsdaily.com/lifestyle/taylor-swift-cdmx-concerts-expected-to-generate-over-1b-pesos-in-revenue/\">Source<\/a>","<b>Edinburgh, England<\/b><br/><br/>The presales for the Eras Tour had a positive impact on consumer spending in the UK in July 2023. For the June 2024 dates of the UK leg, hotels in Edinburgh, Liverpool, and Cardiff were fully booked and sold out by August 2023.<br><br><a href=\"https://www.theguardian.com/travel/2023/aug/24/taylor-swifts-eras-tour-set-to-be-a-big-hit-for-travelodge-hotels\">Source<\/a>","<b>Atlanta, Georgia<\/b><br/><br/>Almost 140,000 people filled Atlanta's Metropolitan Atlanta Rapid Transit Authority (MARTA) system to attend Taylor Swift's concerts at Mercedes-Benz Stadium over three nights. This number was more than three times the usual weekend ridership at stations near the stadium.<br><br><a href=\"https://www.governing.com/transportation/taylor-swift-fans-give-public-transit-a-well-timed-boost\">Source<\/a>","<b>East Rutherford, New Jersey<\/b><br/><br/>The rail and bus services provided during Taylor Swift's Era tour, especially for shows lasting over three hours, were highlighted as a recent success by NJ Transit officials. This achievement was part of a series of successful events, including the 2021 Army-Navy game, as well as concerts by Lady Gaga in 2019, Elton John in 2019, and Ed Sheeran in 2018.<br><br><a href=\"https://www.nj.com/news/2023/05/nj-transit-moved-80k-to-taylor-swift-concerts-at-metlife-on-memorial-day-weekend.html\">Source<\/a>","<b>Melbourne, Australia<\/b><br/><br/>Virgin Australia experienced a remarkable 656 percent surge in bookings to Melbourne and Sydney for Taylor Swift's concert dates following the Frontier pre-sale that took place on Wednesday.<br><br><a href=\"https://www.news.com.au/travel/travel-advice/flights/taylor-swift-causes-huge-spike-in-flight-and-hotel-bookings-for-melbourne-and-sydney/news-story/97f45d23208f8c01d9b68c9e1e4e3b29\">Source<\/a>","<b>Singapore<\/b><br/><br/>UOB bank credit card holders were granted preferred access to Taylor Swift's concert, leading to a 45 percent increase in daily credit card applications in Singapore, Thailand, Malaysia, Indonesia, and Vietnam during the week when Swift announced her concert dates, as reported by the media.<br><br><a href=\"https://www.reuters.com/lifestyle/millions-vie-tickets-taylor-swifts-only-stop-southeast-asia-2023-07-07/\">Source<\/a>"],{"interactive":false,"permanent":false,"direction":"auto","opacity":1,"offset":[0,0],"textsize":"10px","textOnly":false,"className":"","sticky":true,"maxWidth":50},null]}],"limits":{"lat":[-37.8142454,51.46327795],"lng":[-121.6846349,144.9631732]}},"evals":[],"jsHooks":[]}</script>
